import React from 'react';

import "../../style/projectTitle.css";


const ProjecTitle = (props) => (
    <>
        <div>
            <div>
                <h1>{props.company}</h1>

                <h2>{props.projectName}</h2>

                <h3>{props.projectDescription}</h3>

                <img src = {props.tag1} className = ""></img>
                <img src = {props.tag2} className = ""></img>
                <img src = {props.tag3} className = ""></img>
                <img src = {props.tag4} className = ""></img>
                <img src = {props.tag5} className = ""></img>
                <img src = {props.tag6} className = ""></img>
            </div>
        
            <img src = {props.projectImage} className = "projectImage"></img>
            </div>
        {/* differentiate regular vs mobile in classes and light vs dark*/}
    </>
);

export default ProjecTitle;
